eval("var markdown = \"\\n## Cuando el agua no es una bendici\\xF3n\\n<br/>\\n\\n### Tasajera y la Anatom\\xEDa Social\\n<br/>\\n\\nSalimos desde Barranquilla por la troncal Caribe, lo primero que encontramos al lado\\nderecho de la v\\xEDa una vez cruzamos el r\\xEDo Magdalena, es la Ci\\xE9naga Grande de Santa\\nMarta, la laguna de agua salada m\\xE1s grande y productiva del caribe colombiano, con unas\\n528 mil hect\\xE1reas de extensi\\xF3n, es formada en tierras bajas contiguas al mar Caribe, y se\\nencuentra aislada de este por un cord\\xF3n o banco de arena, justamente encima de ese\\nbanco de arena se construy\\xF3 la v\\xEDa por la que transitamos.\\n<br/>\\n\\nEl paisaje var\\xEDa, entre m\\xE1s te alejas de Barranquilla y te acercas a Ci\\xE9naga, aparecen\\npoblaciones que a simple vista reflejan las condiciones deplorables en las que sobreviven\\nsus habitantes.\\n<br/>\\n\\nCompartimos veh\\xEDculo con una persona mayor, de las que la sabidur\\xEDa y los a\\xF1os ya ni abrir\\nlos ojos completamente le permiten, al escuchar el comentario que surgi\\xF3 directamente\\nrelacionado a las condiciones de habitabilidad en este sector, nuestro octogenario\\ncompa\\xF1ero de ruta de forma calmada y sin siquiera presentarse, a\\xF1adi\\xF3:\\n<br/>\\n\\n- Compartimos veh\\xEDculo con una persona mayor, de las que la sabidur\\xEDa y los a\\xF1os ya ni abrir\\n  los ojos completamente le permiten, al escuchar el comentario que surgi\\xF3 directamente\\n  relacionado a las condiciones de habitabilidad en este sector, nuestro octogenario\\n  compa\\xF1ero de ruta de forma calmada y sin siquiera presentarse, a\\xF1adi\\xF3:\\n<br/>\\n\\nFrente a la mirada desconcertada de nosotros, sigui\\xF3:\\n<br/>\\n\\n- Lo s\\xE9, justamente porque estuve all\\xED, descargando y cargando las embarcaciones\\n  con ese poco e\\u2019 pescao y vainas raras que se ve\\xEDan, yo creo que a\\xFAn me deben oler\\n  a pescado las manos y los codos. Ni se imaginan con esas calores y el \\u201Cmono\\u201D (sol)\\n  en su furor lo que significaba esa vaina, ni sindicatos exist\\xEDan, ni las vainas esas de\\n  leyes de trabajo que hay ahora.\\n<br/>\\n\\nNuestras miradas gritaban la pregunta siguiente, al punto de no necesitar formularla, el\\nse\\xF1or, que despu\\xE9s se present\\xF3 como Hugo, coment\\xF3:\\n<br/>\\n\\n- Y aj\\xE1 \\xBFqu\\xE9 es lo que pas\\xF3? se preguntan, si o \\xBFqu\\xE9?. Pues bueno, pas\\xF3 que entr\\xF3 el\\n  progreso, las v\\xEDas que se construyeron mataron parte del ecosistema, vinimos a\\n  saber que as\\xED se llamaba cuando ya estaba jodido. Y bueno, en parte todo el pueblo\\n  se dedic\\xF3 a lo mismo, es como cuando se sobrecarga un enchufe con varias \\u201CT\\u201D o\\n  conexiones, como en navidad, hay cortocircuitos y apagones. Los peces, las ostras,\\n  los moluscos, se perdieron, y en gran parte la forma en que se sosten\\xEDan estos\\n  pueblos, algunos logramos irnos, otros se quedaron aqu\\xED, d\\xF3nde no hay nada que\\n  hacer.\\n<br/>\\n\\nContinuamos charlando en el camino hasta que el se\\xF1or Hugo se baj\\xF3 en Ci\\xE9naga, nosotros\\ncontinuamos hacia Santa Marta, la corta conversaci\\xF3n en la ruta nos permiti\\xF3 cambiar la\\npercepci\\xF3n sobre estas poblaciones que viven inmersas en agua salada y que ya se han\\nconvertido en parte del paisaje por la normalizaci\\xF3n de sus deplorables formas de sobrevivir\\nen quienes transitamos constantemente esta v\\xEDa que ir\\xF3nicamente lleva el t\\xEDtulo \\u201CDe la\\nProsperidad\\u201D.\\n<br/>\\n\\nD\\xEDas despu\\xE9s decidimos retomar el camino, esta vez con veh\\xEDculo propio y fotografiar esta\\nrealidad, fuimos recibidos por lugare\\xF1os que trabajan en peajes cercanos, a quienes\\nconocimos de tanto ver en el mismo kiosco al transitar constantemente por esta ruta.\\nLo que vimos en muchos momentos, mientras camin\\xE1bamos con ellos, resultaba ficticio\\npara quienes habitamos en privilegios como techo, comida o internet, lo que primero llam\\xF3\\nnuestra atenci\\xF3n fue la inexistencia de servicios p\\xFAblicos, en gran parte de la poblaci\\xF3n,\\nespecialmente los denominados b\\xE1sicos como el de aseo o de acueducto, ni hablar de la\\nelectrificaci\\xF3n que en muchos casos provienen de conexiones dudosas a cables de alta\\ntensi\\xF3n que se levantan encima de la troncal.\\n<br/>\\n\\nEsta al igual que muchas poblaciones anfibias de nuestro Caribe vive rodeada de un agua\\nque no cumple con su fin de dar vida, sino que al contrario, aloja desechos y es cuna de\\ninfecciones, enfermedades cut\\xE1neas, g\\xE1stricas y respiratorias ya normales en sus\\nhabitantes.\\n<br/>\\n\\nContinuamos con nuestro recorrido, entendiendo c\\xF3mo emplean los desechos para subir los\\nniveles de sus casas, debido a que habitan en una condici\\xF3n de riesgo no mitigable, es\\ndecir, en \\xE9poca de invierno o lluvias, siempre, no algunas veces, siempre se van a inundar,\\nla recursividad de no contar con un servicio de aseo, los lleva a construir sus cimientos de\\ncasas con la basura que cada uno desecha.\\n<br/>\\n\\n![alt text](https://res.cloudinary.com/kribi/image/upload/v1594438931/WhatsApp_Image_2020-06-29_at_12.19.41_PM_1_xoybdr.jpg)\\n\\nLlegamos hasta el colegio del corregimiento, en total abandono, sin embargo, en esas\\ncondiciones los ni\\xF1os que pueden y deciden estudiar aprenden en tableros de tiza ya\\ndesgastados a pronunciar y escribir bien sus primeras letras o palabras, buscando ser la\\nexcepci\\xF3n a la regla, como fue el caso del se\\xF1or Hugo y poder salir de su pueblo, debido a\\nla inexistencia de oportunidades de desarrollo all\\xED.\\n<br/>\\n\\nNos despedimos de quienes amablemente nos recibieron y al volver a la carretera nos\\ntopamos con lo que en forma de advertencia nos previnieron los lugare\\xF1os anfitriones, la\\nforma de saqueo como \\xFAnico medio de subsistencia para algunas familias del sector, no con\\nnosotros, en este caso, sino con un accidente que ten\\xEDa parado el tr\\xE1fico.\\n<br/>\\n\\nEs normal mencionar que son \\u201Cterrenos de nadie\\u201D y esa frase hace alusi\\xF3n a la Anomia\\nSocial, que no es nada m\\xE1s que la inexistencia de normas b\\xE1sicas de convivencia debido a\\nla realidad alterada en la que habitan y sobreviven estas personas.\\n<br/>\\n\\nCon este especial abordamos cuatro principales territorios anfibios del Caribe Colombiano,\\ndos ubicados sobre la ci\\xE9naga grande de Santa Marta y dos ubicados sobre el Mar Caribe.\\nCuriosamente cada uno cerca a grandes ciudades y focos de desarrollo de la Regi\\xF3n.\\n<br/>\\n<br/>\\n\\n![alt text](https://res.cloudinary.com/kribi/image/upload/v1594443158/WhatsApp_Image_2020-07-06_at_9.18.11_PM_nneclx.jpg)\\n<br/>\\n<br/>\\n![alt text](https://res.cloudinary.com/kribi/image/upload/v1594443158/WhatsApp_Image_2020-06-29_at_12.19.41_PM_szikzq.jpg)\\n<br/>\\n<br/>\\n![alt text](https://res.cloudinary.com/kribi/image/upload/v1594443157/WhatsApp_Image_2020-06-29_at_12.19.39_PM_yyboqm.jpg)\\n<br/>\\n<br/>\\n![alt text](https://res.cloudinary.com/kribi/image/upload/v1594443157/WhatsApp_Image_2020-07-07_at_7.06.28_AM_j6n7sn.jpg)\\n\";\nmodule.exports = markdown;\n\n//# sourceURL=webpack:///./public/markdown/cuando-el-agua-no-es-bendici%C3%B3n.js?");

