eval("var markdown = \"\\n## J\\xF3venes con visi\\xF3n 2020\\n<br/>\\n\\nEl futuro de una sociedad est\\xE1 determinado en c\\xF3mo configure su presente. Los\\ngrandes creadores de nuevas formas e ideolog\\xEDas religiosas, pol\\xEDticas, econ\\xF3micas,\\nart\\xEDsticas, cient\\xEDficas y tecnol\\xF3gicas en su mayor\\xEDa fueron j\\xF3venes que identificaron desde\\nde su cosmovisi\\xF3n del mundo oportunidades. En los \\xFAltimos meses, j\\xF3venes de diferentes\\nlugares del mundo han decidido alzar sus voces y exigir la inclusi\\xF3n en los espacios, en\\ndonde la gerontocracia es evidente. Tal es el caso de Colombia, donde la constituci\\xF3n y las\\nleyes son incluyentes. Las propuestas est\\xE1n encaminadas a garantizar no solo la\\nparticipaci\\xF3n de la juventud sino tambi\\xE9n a las diferentes ideol\\xF3gicas, brindando\\nrepresentatividad de la diversidad y las diferentes expresiones sociales.\\n<br/>\\n\\nEn el d\\xEDa 21 de diciembre, en el sal\\xF3n Galer\\xEDa de la Plaza de la Paz en la ciudad de\\nBarranquilla se llev\\xF3 a cabo la Asamblea para la Elecci\\xF3n y Conformaci\\xF3n de la Comisi\\xF3n\\nConsultiva Departamental de las Comunidades Negras, Afrocolombianas, Raizales y\\nPalenqueras. En el evento j\\xF3venes l\\xEDderes de procesos sociales y culturales manifestaron\\nsu inter\\xE9s en abanderar procesos sin desconocer la experiencia de otras generaciones, sino\\npidiendo un voto de confianza como el acompa\\xF1amiento para aprender y trabajar juntos de\\nla mano en el construir de un mejor pa\\xEDs.\\n<br/>\\n\\nLa apertura a la intervenci\\xF3n de diferentes sectores sociales permite evitar el\\ndescontento ante la organizaci\\xF3n ama\\xF1ada de pocos dirigentes comunitarios y abolir la\\nrepresi\\xF3n participativa. \\xDAltimamente es claro que los j\\xF3venes donde m\\xE1s c\\xF3modos se\\nsienten, m\\xE1s se expresan y participan es en las calles. _Reclamando justamente espacios\\nm\\xE1s amplios de participaci\\xF3n donde sean efectivamente escuchados y puedan expresar sus\\nopiniones con fuerza, sin coacciones, sin l\\xEDmites_. (Rodr\\xEDguez, 2016).\\n<br/>\\n\\nHoy la tarea de los j\\xF3venes es activar su intervenci\\xF3n en toma de decisiones y\\nacciones comunitarias a trav\\xE9s de la organizaci\\xF3n legal. Alvarez, (2013) Afirma que,\\n\\n**_Las organizaciones juveniles pueden ser una primera instancia de inserci\\xF3n\\ndel sujeto al colectivo social. Un espacio social tan importante como la familia y la\\nescuela, son espacios que potencian el sentido de lo colectivo y donde se ejercita la\\ndin\\xE1mica transformadora del sujeto y de la realidad. Estas instituciones son la base\\npara desarrollar actitudes y capacidades de participaci\\xF3n democr\\xE1tica en diferentes\\nescenarios de lo social y el puente para integrar otro tipo de organizaciones. Por\\ntanto, los procesos de formaci\\xF3n en cultura pol\\xEDtica que se logren desarrollar con\\nactores sociales como los j\\xF3venes son fundamentales._** (p.71)\\n<br/>\\n\\nlo anterior, proclive al empoderamiento en aras a dar respuesta a lo que dicta la Carta\\nMagna Colombiana. El Estado y la sociedad garantizan la participaci\\xF3n activa de los\\nj\\xF3venes en los organismos p\\xFAblicos y privados que tengan a cargo la protecci\\xF3n, educaci\\xF3n\\ny progreso de la juventud. (Art. 45 Constituci\\xF3n Pol\\xEDtica de Colombia, 1991). Esta directriz\\nse ratifica en la Ley 375 de 1997 y el Decreto 0089 de Febrero 2 de 2000 por el cual se\\nreglamenta la organizaci\\xF3n y el funcionamiento de los Consejos de Juventud y se dictan\\notras disposiciones entre ellas la dada en el art\\xEDculo 2, literal 4. Fomentar la creaci\\xF3n de\\norganizaciones y movimientos juveniles, en la respectiva jurisdicci\\xF3n.\\n<br/>\\n\\nEn conclusi\\xF3n, los j\\xF3venes desde siempre han hecho parte de las grandes\\ntransformaciones sociales, su cosmovisi\\xF3n fomentan una cultura de la participaci\\xF3n,\\nasumiendo responsabilidad de liderazgo y recreando un mundo con visi\\xF3n amplia, integral y\\nhumanista. Dentro de las grandes ventajas que brinda la nueva generaci\\xF3n de la juventud\\nencontramos el compromiso con el presente y el futuro, seres aut\\xF3nomos y cr\\xEDticos con su\\npropia perspectiva social y pol\\xEDtica.\\n<br/>\\n<br/>\\n<br/>\\n<br/>\\n<br/>\\n<br/>\\n<br/>\\n\\nReferencias\\n\\nRodr\\xEDguez, E. (2016). LA PARTICIPACI\\xD3N DE LOS J\\xD3VENES EN LAS POL\\xCDTICAS\\nP\\xDABLICAS DIRIGIDAS A ELLOS. Disponible en:\\n\\nhttp://www.publicaciones.siteal.iipe.unesco.org/eventos-del-siteal/22/la-participacion-\\nde-los-jovenes-en-las-politicas-publicas-dirigidas-ellos\\n\\n\\xC1lvarez, M. (2013). LAS ORGANIZACIONES JUVENILES, UN CAMINO PARA LA\\nCONSTRUCCI\\xD3N DE CULTURA POL\\xCDTICA DEMOCR\\xC1TICA EN EL MUNICIPIO DE\\nGUACAR\\xCD, COLOMBIA. [online] Latinoamericana.ucaldas.edu.co. Disponible en:\\nhttp://latinoamericana.ucaldas.edu.co/downloads/Latinoamericana9(2)_4.pdf\\n[Accessed 23 Dec. 2019].\\n\";\nmodule.exports = markdown;\n\n//# sourceURL=webpack:///./public/markdown/j%C3%B3venes-con-visi%C3%B3n-2020.js?");

