eval("var markdown = \"\\n# La Champeta: nuestro reencuentro con \\xC1frica.\\n<br/>\\n<br/>\\n\\n\\xBFSer\\xE1 que ya ha llegado el momento en que la champeta trascienda como g\\xE9nero musical que represente y cohesione a Colombia a un nivel tanto nacional como internacional?... Decir que s\\xED podr\\xEDa considerarse un poco apresurado. Pero, es innegable el gran momento que \\xFAltimamente ha estado experimentando este g\\xE9nero. Basta s\\xF3lo con mencionar la aclamada presentaci\\xF3n de la superestrella colombiana, Shakira, en el medio tiempo de un mega evento como el Super Bowl. Esos minutos fueron una plataforma sin precedentes para mostrar la champeta como baile y g\\xE9nero musical. Aunque a\\xFAn muchos discutan si lo que bail\\xF3 Shakira fue champeta o soukous (g\\xE9nero musical proveniente de la cuenca del R\\xEDo Congo, centro del continente africano, y que adem\\xE1s, es una de las bases r\\xEDtmicas de la champeta), lo cierto es que luego de dicha presentaci\\xF3n, aument\\xF3  el inter\\xE9s tanto en Colombia como en el mundo sobre este sonido urbano que comenz\\xF3 a desarrollarse a partir  de la d\\xE9cada de los setentas en los barrios perif\\xE9ricos, predominantemente de poblaci\\xF3n negra de Cartagena de Indias a orillas del Mar Caribe.\\n<br/>\\n\\nEl origen de la champeta puede ser considerado como una manifestaci\\xF3n de los contextos urbanos en el Gran Caribe donde luego de la segunda mitad del siglo XX, g\\xE9neros musicales producto de la fusi\\xF3n de ritmos comenzaron a surgir como el caso del reggae (Jamaica), el dancehall (Jamaica), el soca (Trinidad y Tobago), el kompas (Hait\\xED) y el zouk (Antillas Francesas), por ejemplo. Todas estas m\\xFAsicas caribe\\xF1as tienen en com\\xFAn la forma de difusi\\xF3n, a trav\\xE9s de parlantes de sonido potente, en el caso particular de la champeta, a trav\\xE9s del pic\\xF3. El desarrollo de la champeta no es ajena a esta realidad debido a que sus bases r\\xEDtmicas son producto de la fusi\\xF3n de diversos g\\xE9neros musicales, entre estos est\\xE1n: soukous, j\\xF9j\\xFA, highlife, kompas, bullerengue, mapal\\xE9, zambapalo, chalupa y en menor medida reggae, as\\xED como tambi\\xE9n, ritmos afro-brasileros.\\n<br/>\\n\\nAntes que existiera lo que hoy es conocido como champeta, los pic\\xF3s (sound systems o sistemas de sonido potente), que posteriormente se convirtieron en el principal s\\xEDmbolo de un g\\xE9nero y un movimiento cultural como la champeta, resonaban, en los barrios populares de ciudades del Caribe colombiano como Cartagena, Barranquilla y Santa Marta, sonidos provenientes de \\xC1frica, contagiosos para el espectador, y que r\\xE1pidamente, fueron bautizados como terapia africana. La denominada terapia africana fue el sonido predominante de los pic\\xF3s entre los a\\xF1os setentas y\\ncomienzo de los ochentas. Posteriormente, en la d\\xE9cada de los ochentas, artistas locales en Cartagena provenientes de San Basilio de Palenque, empezaron a impulsar la denominada terapia criolla que era una adaptaci\\xF3n de aquellos sonidos provenientes de \\xC1frica y sobre esos ritmos se comenzaron a incluir letras en espa\\xF1ol y en lengua palenquera. De este modo, la champeta comenz\\xF3 a tener una identidad y un estilo que la diferenciaba de su antecesora, la terapia africana.\\n<br/>\\n\\nLos a\\xF1os noventas y principios de los dos mil se puede considerar como la \\xE9poca dorada de la champeta porque adem\\xE1s tener una identidad como g\\xE9nero musical, se consolida como un movimiento cultural en toda la regi\\xF3n Caribe de Colombia, desde La Guajira hasta Turbo en Antioquia,  la champeta se escuchaba masivamente. Pas\\xF3 de sonar de forma casi exclusiva en los barrios populares a sonar tanto en zonas rurales como en sectores de la alta sociedad. A pesar de que la popularidad de la champeta se expandi\\xF3 en diferentes espacios, a\\xFAn se manten\\xEDa el estigma y los prejuicios sobre este tipo de m\\xFAsica por su origen negro y popular. Sin embargo, la champeta es un g\\xE9nero que se reinventa, que contin\\xFAa llamando la atenci\\xF3n tanto de la industria musical comercial como de music\\xF3logos, mel\\xF3manos, picoteros o simplemente de los m\\xE1s sencillos bailadores que solo quieren pasar buen rato.\\n<br/>\\n\\nLa champeta m\\xE1s all\\xE1 de su definici\\xF3n como g\\xE9nero musical, es un reencuentro con nuestras ra\\xEDces africanas, es una forma de resistencia y empoderamientos del ser negro, de la identidad caribe. Representa la voz de un pueblo hist\\xF3ricamente invisibilizado que habla de su cotidianidad, de sus problemas, de sus sue\\xF1os y que con sus letras y ritmos que resuenan en un pic\\xF3 dice: \\xA1ESTO ES LO QUE SOMOS Y AQU\\xCD ESTAMOS!\\n\";\nmodule.exports = markdown;\n\n//# sourceURL=webpack:///./public/markdown/la-champeta:-nuestro-reencuentro-con-%C3%A1frica.js?");

