eval("var markdown = \"\\n# Una ministra cient\\xEDfica\\n<br/>\\n<br/>\\n\\nUna de las apuesta m\\xE1s ambiciosas por parte del gobierno nacional de Colombia es la\\ncreaci\\xF3n del Ministerio de Ciencia, Tecnolog\\xEDa e Innovaci\\xF3n, por medio de la ley 1951 de\\n2019. Esta nueva dependencia del ejecutivo, adem\\xE1s de formular y desarrollar pol\\xEDticas\\np\\xFAblicas dirigidas a la promoci\\xF3n y fortalecimiento del conocimiento cient\\xEDfico y tecnol\\xF3gico,\\ngenera altas expectativas sobre la inserci\\xF3n del pa\\xEDs en los campos de la investigaci\\xF3n e\\ninnovaci\\xF3n como tambi\\xE9n lo ser\\xE1 el impacto en el crecimiento de la productividad,\\ncompetitividad, calidad de la educaci\\xF3n y la reducci\\xF3n de la desigualdad, principalmente en\\nlas regiones de Colombia.  \\n<br/>\\n\\nEste ministerio entrar\\xE1 en funcionamiento a partir del 24 de enero de 2020 con un\\npresupuesto estimado en $393.000 millones de pesos colombianos. A partir de esa fecha\\nreemplazar\\xE1 al Departamento Administrativo de Ciencias, Tecnolog\\xEDa e Innovaci\\xF3n\\n(Colciencias), creado en 1968.  \\n<br/>\\n\\nAdem\\xE1s del anuncio de la creaci\\xF3n del nuevo ministerio, llam\\xF3 la atenci\\xF3n el nombramiento\\nde quien estar\\xE1 a cargo de la cartera, Mabel Gisela Torres Torres, una cient\\xEDfica\\nafrocolombiana originaria del municipio de Bah\\xEDa Solano en el departamento del Choc\\xF3. Y\\nno era para menos, se trata de la primera mujer y primer afrocolombiana en liderar un\\nministerio desde su creaci\\xF3n.  \\n<br/>\\n\\nTorres es bi\\xF3loga qu\\xEDmica de profesi\\xF3n, tiene un m\\xE1ster en microbiolog\\xEDa (Universidad del\\nValle), m\\xE1ster en innovaci\\xF3n y emprendimiento (Universidad de Barcelona) y un doctorado\\nen ciencias biol\\xF3gicas (Universidad de Guadalajara). Gran parte de su trayectoria ha estado\\ndirigida a la investigaci\\xF3n en la Universidad Tecnol\\xF3gica del Choc\\xF3 \\u201CDiego Luis C\\xF3rdoba\\u201D.\\nTambi\\xE9n se ha destacado como directora de innovaci\\xF3n y desarrollo en Selvace\\xFAtica y\\ncomo directora y ejecutiva de Bioinnova. Durante los \\xFAltimos meses, particip\\xF3 en la\\ndenominada Misi\\xF3n Internacional de Sabio, abordando tem\\xE1ticas como el medio ambiente,\\nla biotecnolog\\xEDa y la bioeconom\\xEDa.  \\n<br/>\\n\\nEl nombramiento de Torres podr\\xEDa interpretarse como una manifestaci\\xF3n de inter\\xE9s en el\\nsector cient\\xEDfico y tecnol\\xF3gico por parte del gobierno nacional. Tambi\\xE9n es importante\\ndestacar que su nombramiento no responder\\xEDa a cuotas burocr\\xE1ticas con los partidos de\\ncoalici\\xF3n debido a que la Ministra Torres no milita en ning\\xFAn partido pol\\xEDtico. Lo anterior, da\\nmuestra de que el ministerio est\\xE1 liderado por un equipo mayoritariamente t\\xE9cnico con\\nexperiencia en los temas que son de su competencia. \\n<br/>\\n\\nA pesar de las intenciones del gobierno por mejorar los indicadores en materia de ciencia,\\ntecnolog\\xEDa e innovaci\\xF3n, Colombia a\\xFAn tiene un enorme reto, comenzando con la inversi\\xF3n\\np\\xFAblica en estas \\xE1reas que son fundamentales para el desarrollo de cualquier Estado.\\nSeg\\xFAn datos del Banco Mundial, Colombia invirti\\xF3 el 0,24% de su PIB en proyectos e\\niniciativas de ciencias y tecnolog\\xEDas en 2017. Mientras que en pa\\xEDses como Estados Unidos,\\nBrasil, Chile y Jap\\xF3n, la inversi\\xF3n en este campo fue del 2,74%; 1,27%; 0,36% y 3,14%,\\nrespectivamente. \\n\";\nmodule.exports = markdown;\n\n//# sourceURL=webpack:///./public/markdown/una-ministra-cientifica.js?");

